msg: "سلام \r\nخدا مادر شما را بیامرزد \r\nدر اولین شب سال ۱۴۰۰، به کمک شما تقویم اندروید را فارسی کردم \r\nاین محصول شما به اندازه خود اپلیکیشن تقویم گوگل برای من ارزشمند است، چون بدون داشتن تقویم هجری شمسی عملا برای ما کاربردی نداشت \r\nبسیار سپاسگزارم \r\nروح مادرتان شاد"
